import React from 'react';
// import logo from './logo.svg';
// import './App.css';
import NavbarSection from '../home/NavbarSection';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import HomeBackgroundImage from '../../assets/img/home-background.png'
import '../../assets/css/home.css'
import BackgroundImage from "react-background-image";

const useStyles = makeStyles(theme => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
}));

export default function Home() {
  const classes = useStyles();

  return (
    <div>
      <div className="container">

        <div>
          <h1> CSS Tricks </h1>
          <h5>
            You can now style the second div and
            heading tags as you see fit
  </h5>
        </div>

      </div>
      <NavbarSection />
      <BackgroundImage
        placeholder={HomeBackgroundImage}
      // src={HomeBackgroundImage}
      // className="myCustomClass"
      // {...otherProps}
      >
        <p>Other element</p>

        {/* <OtherReactComponent /> */}
      </BackgroundImage>

      {/* <ImageBackground source={} style={{ width: '100%', height: '100%' }}>
        <Text>Inside</Text>
      </ImageBackground> */}
      <div styles={{ backgroundImage: `url(${HomeBackgroundImage})` }}>
        {/* <div styles={{ backgroundImage: "url(" + HomeBackgroundImage + ")" }}> */}
        <h1>This is red car</h1>
      </div>
      {/* <img src={HomeBackgroundImage}/> */}

      <div className={classes.root}>
        <Button variant="contained">Default</Button>
        <Button variant="contained" color="primary">
          Primary
      </Button>
        <Button variant="contained" color="secondary">
          Secondary
      </Button>
        <Button variant="contained" disabled>
          Disabled
      </Button>
        <Button variant="contained" color="primary" href="#contained-buttons">
          Link
      </Button>
      </div>
    </div>
  )
}
